message:
Activities do menu do App agora extendem da classe abstrata DefaultActivity;
Removida a barra de menu;
Adcionado botão flutuante que chama o menu;
Adicionado menu lateral deslizante.

Contagem de pontuação;
Evita gerar letras em cima de outra;
Ao arrastar e soltar as letras, se estiver abaixo da metade da tela não retorna mais para a posição de origem.

Adicionados efeitos sonoros [jogoMonatarPalavras];
Adcionado todo alfabeto;
Verificação ao completar a palavra e gerar nova (turno);

Modificada a estrutura do projeto. Os jogos agora funcionam como módulo do app principal;
Adicionado o módulo do jogo da memória;
Adicionado o módulo do jogo de preencher números;
O app principal disponibiliza a opção de escolha dos jogos.

Resolvido bug X e Y do círculo;
Classe SoundPoolPlayer renomeada para SoundList;
Uso da classe Point ao invés de NumberPosition.

Verifica vencedor;
Exibe mensagem vencedor;
Reproduz som ao acertar o número.

Números por jogador;
Verifica a seleção do número correto;
Intercala entre os dois jogadores, sistema de turnos.
